function loadPage (component) {
    // '@' is aliased to src/components
    return () => import(/* webpackChunkName: "[request]" */
    `@/pages/${component}.vue`)}
    export default [
    { path: '/', component: loadPage('HomeOne') },
    { path: '/Blog', component: loadPage('Blog') }
    ]
